import './App.css';

//Components
import Header_Card from "./components/Header-Card";
import Header_Navbar from "./components/Header-Navbar";

class App extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div className="App">
                <header className="header-body bg-gradient-info">
                    <div className="container-fluid">
                        <div className="row">
                            <Header_Navbar/>
                            <div className="container-fluid">
                                <div className="row">
                                    <Header_Card/>
                                    <Header_Card/>
                                    <Header_Card/>
                                </div>
                            </div>
                        </div>
                    </div>
                </header>
                <main className="main">

                </main>
            </div>
        );
    }
}


export default App;
